Here are some important questions to ask each other:

1. What are our individual motivations for exploring non-monogamy?** Understanding each other’s reasons can help empathize with one another and set realistic expectations.

2. How do we define non-monogamy for our relationship?** Define what non-monogamy means to both of you. Is it open relationships, polyamory, swinging, or something else entirely?

3. What are our boundaries and limits?

4. How will we communicate about our other relationships?** Decide on the frequency and depth of communication about your experiences with others. Determine how transparent you’ll be or if you prefer DADT (Don’t Ask Don’t Tell) 

5. What are our plans for dealing with jealousy and insecurity?

6. Are we both comfortable with the idea of our partner having other romantic or sexual connections?

7. What happens if one of us wants to stop being non-monogamous?

8. How will we handle disagreements or conflicts related to non-monogamy?** Establish conflict resolution strategies.

9. Do we have a plan for safer sex and regular health check-ups?

10. Are we willing to seek outside support or counseling if needed?
